import React from 'react'

const Index=()=>{
  return <div>
    Inicio
  </div>
}

const Usuario=()=>{
  return (
    <form>
      <input placeholder="Nombre"/>
      <input placeholder="Paterno"/>
      <input placeholder="Materno"/>
    </form>
  )
}

export default Index
